import * as React from 'react';
import { DataGrid } from '@mui/x-data-grid';
import {
  randomCreatedDate,
  randomTraderName,
  randomUpdatedDate,
} from '@mui/x-data-grid-generator';
import { useGlobalContext } from '../context';

export default function Roles() {
  const {roles} = useGlobalContext()
  console.log(roles)
  const transformed = roles.map(({ deleted, role_id, role_name }) => ({ deleted, id: role_id, role_name }));
  return (
    <div style={{display: 'flex', marginTop: 80, justifyContent: "center"}} >
        {/* <div style={{ display: 'flex', height: '100%' }}> */}
          <div style={{ flexGrow: 1 }}>
          <DataGrid
            rows={transformed}
            columns={columns}
            experimentalFeatures={{ newEditingApi: true }}
          />
      </div>
      {/* </div> */}
    </div>
    
  );
}

const columns = [
  // { field: 'deleted', headerName: 'Name', width: 180, editable: true },
  // { field: 'role_id', headerName: 'Age', type: 'number', editable: true },
  {
    field: 'role_name',
    headerName: 'Role Name',
    width: 180,
    editable: true,
  }
];

const rows = [
  {
    id: 1,
    name: randomTraderName(),
    age: 25,
    dateCreated: randomCreatedDate(),
    lastLogin: randomUpdatedDate(),
  },
  {
    id: 2,
    name: randomTraderName(),
    age: 36,
    dateCreated: randomCreatedDate(),
    lastLogin: randomUpdatedDate(),
  },
  {
    id: 3,
    name: randomTraderName(),
    age: 19,
    dateCreated: randomCreatedDate(),
    lastLogin: randomUpdatedDate(),
  },
  {
    id: 4,
    name: randomTraderName(),
    age: 28,
    dateCreated: randomCreatedDate(),
    lastLogin: randomUpdatedDate(),
  },
  {
    id: 5,
    name: randomTraderName(),
    age: 23,
    dateCreated: randomCreatedDate(),
    lastLogin: randomUpdatedDate(),
  },
];
